import{_ as t,o,c as a,z as e,a as s}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 24.2-661 Detection and setting aside of double ballots.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/24.2-661.md","filePath":"vacode/24.2-661.md"}'),n={name:"vacode/24.2-661.md"},l=e("h1",{id:"§-24-2-661-detection-and-setting-aside-of-double-ballots",tabindex:"-1"},[s("§ 24.2-661 Detection and setting aside of double ballots. "),e("a",{class:"header-anchor",href:"#§-24-2-661-detection-and-setting-aside-of-double-ballots","aria-label":'Permalink to "§ 24.2-661 Detection and setting aside of double ballots."'},"​")],-1),d=e("p",null,"After the votes on all voting and counting equipment have been determined and recorded, the officers of election shall proceed to examine and count the paper ballots to ascertain if any double ballots have been cast, and whether the number of ballots corresponds with the number of names on the pollbooks of persons who voted on paper ballots. If two or more separate ballots are found so folded together as to represent the appearance of a single ballot they shall be laid aside until the count of the ballots is completed. If, upon a comparison of the count and the number of names of such qualified voters on the pollbooks, it appears that the two or more ballots thus folded together were cast by the same qualified voter, they shall be set aside and not counted.",-1),r=e("p",null,"Code 1950, §§ 24-262, 24-313; 1970, c. 462, §§ 24.1-138, 24.1-223; 1983, c. 461; 1985, c. 458; 1993, c. 641.",-1),i=[l,d,r];function c(h,f,p,b,u,m){return o(),a("div",null,i)}const g=t(n,[["render",c]]);export{v as __pageData,g as default};
